import React from 'react'

function Skill({ title, progress }) {
    return (
        <div className="skills">
            <div>
                {title}
            </div>
            <div className="progress">
                <div className="progress-bar" style={{width:`${progress}%`}}>
                    {progress}%
            </div>
            </div>
        </div>
    )
}

export default Skill
